"use strict";(self.webpackChunkmy_app=self.webpackChunkmy_app||[]).push([[418],{418:e=>{e.exports=JSON.parse('{"email":"Send meg en e-post","cv":"CV-en min","role":"Programvareutvikler og Norge-entusiast","description":"Hall\xe5! Jeg er en {age} \xe5r gammel Full Stack Programvareutvikler, spesialisert i front-end development. Jeg har fulgt et 4-\xe5rige IT {bachelorLink} ved Hogeschool Utrecht, Nederland.","norwaypart1":"Norge har alltid v\xe6rt mer enn bare et sted p\xe5 kartet for meg. Det fantastiske landskapet, den rike historien og en blanding av tradisjon og modernitet har fengslet meg. \xc5 v\xe6re flytende i norsk har styrket min tilknytning til kulturen, og gjort hver opplevelse\u2014fra \xe5 utforske fjorder til \xe5 engasjere seg i de varme samfunnene\u2014mye mer meningsfull.","norwaypart2":"Jeg er inspirert av Norges vennlighet og b\xe6rekraft og venter spent p\xe5 dagen jeg kan kalle dette ekstraordin\xe6re landet mitt hjem.","skillstitle":"Mine ferdigheter","skillsdescription":"Utforsk programvareferdighetene jeg har for \xe5 bringe ideer ut i livet med enkelhet og presisjon.","frontenddescription":"Jeg elsker \xe5 lage rene, brukervennlige nettsider med React og JavaScript, med fokus p\xe5 design som folk faktisk liker \xe5 bruke.","backenddescription":"Jeg jobber p\xe5 baksiden med Java, Spring og C#, og bygger solide systemer. Jeg bruker ogs\xe5 Python og PostgreSQL for \xe5 h\xe5ndtere data og s\xf8rge for at alt g\xe5r knirkefritt.","devopsdescription":"Jeg bruker verkt\xf8y som Azure, Docker og Powershell for \xe5 str\xf8mlinjeforme distribusjon og administrere skyinfrastruktur, med Git og GitHub for versjonskontroll og samarbeid.","testingdescription":"Jeg jobber med JUnit5 og Postman for testing, og jeg utvikler i milj\xf8er som IntelliJ IDEA og Visual Studio Code.","worktitle":"Mine prosjekt","workdescription":"Ta en titt p\xe5 alle produktene jeg har laget for skoleprosjekt, praksisplasser, sideprosjekter og jobber.","luftandescription":"Luftan er et svensk selskap som spesialiserer seg p\xe5 aromadiffusorer og skandinavisk-inspirerte dufter. Prosjektet inkluderer en full e-handelsplattform der brukere kan bla gjennom produkter, legge til varer i handlekurven og legge inn bestillinger. Jeg utviklet hele siden fra bunnen av, og dekker b\xe5de front-end og back-end utvikling.","candidateportaldescription":"Mysolution er et internasjonalt selskap som tilbyr en Salesforce-applikasjon for rekrutteringsbyr\xe5er. I mitt internship for HBO Bachelor IT Software Development-studiet m\xe5tte jeg opprette en onboarding-portal for en kunde av Mysolution, slik at de ansatte til nevnte kunde kunne fylle ut sin legitimasjon (personalia, bankkontoinformasjon, personvernerkl\xe6ringer osv.). Jeg m\xe5tte ogs\xe5 forske p\xe5 hvordan man h\xe5ndterer sanselig brukerdata i henhold til EU-loven (GDPR) og be brukere om tillatelse til \xe5 lagre dataene deres.","huskelistedescription":"HuskeListe er en enkel norsk gj\xf8rem\xe5lsapp som lar brukere legge til, krysse av og fjerne oppgaver fra listene sine, og hjelpe dem med \xe5 holde orden.","smartfinancedescription":"SmartFinance er en nettapplikasjon for Hogeschool Utrechts \'Bedrijfskunde\'-studenter. Det hjelper dem \xe5 \xf8ve seg p\xe5 \xe5 lage \'jaarrekeningen\' (\xe5rsregnskap) og gir umiddelbar tilbakemelding for \xe5 forberede seg til tester og lekser.","kpndescription":"KPN Reisbewegingen er et nettsted for KPN-ansatte for \xe5 logge sine reisedata, som deretter settes sammen til en Excel-rapport. Ledere kan se avdelingsstatistikk, og en ledertavle oppfordrer til \xe5 redusere CO2-utslipp.","seeproject":"Se prosjekt"}')}}]);